import {
    computed, makeAutoObservable,
    toJS
} from "mobx";
import {
    booksSearch
} from "../services/index.js";

class Mobx {
    booksData = {}

    constructor() {
        makeAutoObservable(this, {
            getBooksData: computed
        });
    }

    get getBooksData() {
        return this.booksData;
    }

    booksSearch = async (data) => {
        await booksSearch(data).then(event => {
            console.log(event.data);
            this.booksData = event.data;
        });
        console.log(toJS(this.booksData))
    }
}

const MyMobx = new Mobx();
export default MyMobx;
